import React from 'react';
import Logo from '../img/logoHenry.png'
import SearchBar from './SearchBar.jsx';
import './Nav.css';
import {Link} from "react-router-dom"

function Nav({onSearch}) {
  return (
    <nav className="navbar_container">
      <Link to='/'>
  
    </Link>
    <SearchBar
      onSearch={onSearch}
    />
    </nav>
  );
};

export default Nav;
